import "./App.css";
import { useState, useEffect } from "react";
import axios from "axios";
import { Tabs, Radio } from "antd";

const { TabPane } = Tabs;

function App() {
  const [banks, setBanks] = useState([]);
  useEffect(() => {
    axios.get("/api/banks").then((data) => setBanks(data));
  }, []);
  console.log(banks);
  return (
    <div className="App">
      <Tabs defaultActiveKey="1">
        <TabPane tab="Tab 1" key="1">
          Content of tab 1
        </TabPane>
        <TabPane tab="Tab 2" key="2">
          Content of tab 2
        </TabPane>
        <TabPane tab="Tab 3" key="3">
          Content of tab 3
        </TabPane>
      </Tabs>
    </div>
  );
}

export default App;
